	private static void checkNeighbor(int i, int j, int k, List<Integer> list, int[] mat){
		Stack<Integer> block = new Stack<Integer>();
		block.push(i);
		block.push(j);
		block.push(k);
		
		while (!block.isEmpty()) {
			k = block.pop();
			j = block.pop();
			i = block.pop();
			if (mat[i * width + j - 1] != 0 && !list.contains(mat[i * width + j - 1])) {
				list.add(mat[i * width + j - 1]);
			}

			if (mat[i * width + j + 1] != 0 && !list.contains(mat[i * width + j + 1])) {
				list.add(mat[i * width + j + 1]);
			}

			if (mat[(i + 1) * width + j] != 0 && !list.contains(mat[(i + 1) * width + j])) {
				list.add(mat[(i + 1) * width + j]);
			}

			if (mat[(i - 1) * width + j] != 0 && !list.contains(mat[(i - 1) * width + j])) {
				list.add(mat[(i - 1) * width + j]);
			}
		}
	}
	
	private static boolean isBoundaryBlack(int[] mat){
		
		for(int i = 0 ; i < width ; i++){
			if(mat[i] == 0) return true;
			if(mat[width * (height - 1) + i] == 0) return true;
		}
		
		for(int i = 1 ; i < height - 1 ; i++){
			if(mat[width * i] == 0) return true;
			if(mat[width * i + width - 1] == 0) return true;
		}
		
		return false;
	}
	
	private static void recurs(int i , int j, int d, final int val, int[] x){
    	Stack<Integer> block = new Stack<Integer>();
		block.push(i);
		block.push(j);
		block.push(d);

		x[d * height * width + i * width + j] = val;
		
		while(!block.isEmpty()){
			d = block.pop();
			j = block.pop();
			i = block.pop();

			x[d * height * width + i * width + j] = val;

			//check right
			if(j != width - 1 && x[d * height * width + i * width + j + 1] == 0){
				block.push(i);
				block.push(j+1);
				block.push(d);
			}

			//check left
			if(j != 0 && x[d * height * width + i * width + j - 1] == 0){
				block.push(i);
				block.push(j-1);
				block.push(d);
			}

			//check down
			if(i != height - 1 && x[d * height * width + (i+1) * width + j] == 0){
				block.push(i+1);
				block.push(j);
				block.push(d);
			}

			//check up
			if(i != 0 && x[d * height * width + (i-1) * width + j] == 0){
				block.push(i-1);
				block.push(j);
				block.push(d);
			}
			
			//check above
			if(d != depth - 1 && x[d * height * width + i * width + j] == 0){
				block.push(i);
				block.push(j);
				block.push(d+1);
			}
			
			//check below
			if(d != 0 && x[d * height * width + i * width + j] == 0){
				block.push(i);
				block.push(j);
				block.push(d-1);
			}
		}
    }

	
